import React from "react";

const QuestionsList = ({questions}) => (
    <div>
        <table border={1}>
            <thead>
            <tr>
                <th> Title </th>
                <th> Question </th>
            </tr>
            </thead>
            <tbody>
                {
                    questions.map((question, index)=>(
                        <tr key={{index}}>
                            <td>{question.title}</td>
                            <td>{question.question}</td>
                        </tr>
                    ))
                }
            </tbody>
        </table>

    </div>
);
export default QuestionsList;
